                <h2 className="text-2xl font-bold mb-4">Cuenta</h2>
                <div className="flex items-center justify-start mb-6">
                    <img  className="h-full w-full rounded-full" src={userIcon} alt="Avatar"/>
                </div>
                <div className="mb-4 text-left">
